import React from 'react';
import './App.css';
// import './Components/Nav/Nav.css';
import Nav from './Components/Nav/Nav';
import Body from './Components/Body/Body';
import Footer from './Components/Footer/Footer';

function App() {
  return (
    <div className="App">
      <Nav></Nav>
      <Body></Body>
      <Footer></Footer>
    </div>
  );
}

export default App;
